import React from "react";

class SendMoney extends React.Component {
  state = {
    resiver: null,
    amount: 0
  };
  render() {
    return (
      <div>
        <div>
          <label>Receiver</label>
          <input></input>
          <label>Amount</label>
          <input></input>
          <button type="button">Send</button>
        </div>
        <div>
          <label></label>
        </div>
      </div>
    );
  }
}

export default SendMoney;
